synth_top::~synth_top() {
    if (mVcdFile) 
        sc_close_vcd_trace_file(mVcdFile);

    mHdltvinHandle << "] " << endl;
    mHdltvoutHandle << "] " << endl;
    mHdltvinHandle.close();
    mHdltvoutHandle.close();
    delete synth_top_smo_io_s_axi_U;
    delete synth_top_writeResult_U0;
}

void synth_top::thread_ap_clk_no_reset_() {
    ap_CS = ap_const_logic_0;
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        ap_reg_procdone_synth_top_writeResult_U0 = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, ap_sig_hs_done.read())) {
            ap_reg_procdone_synth_top_writeResult_U0 = ap_const_logic_0;
        } else if (esl_seteq<1,1,1>(ap_const_logic_1, synth_top_writeResult_U0_ap_done.read())) {
            ap_reg_procdone_synth_top_writeResult_U0 = ap_const_logic_1;
        }
    }
}

